node.text:
Yesterday late evening I was walking the lit up suspension bridge over the Ganges. There was nobody, just the magnificent presence of heavy monsoon rain.
.
First I was emptied of thoughts by the mere mystery of the scene, but half the way over the bridge - captured in space of perfect symmetry right over the middle of the sprawling roaring Ganges - I remembered to make a wish.
.
I always make a wish there. Also these days the energy of the Ganga close to her source in her high monsoon season is otherworldly. Strangely enough, I could not think of any wish to make...what can I possibly ask for, when the world is in similar storm to the nature around me now? All my desires seem so small.
.
But then I made a wish
To see the brand new world.
.
So let's get to work, CREATORS !!!
.
@julie.rappard55 - who is my biggest inspiration in life, the music of my soul
@inna.kelapa - who can smash all the art schools in the world with a few online launches of her drawing course
@simonwoolvertontravels - who is secretly but steadily working on a software of the future that we all will use
@kvduongart - who is a restless experimenter in contemporary art techniques and is conveying his messages through paintings, challenging the status quo of society
@ali.mis , @archi.camillacasadio - who are designing interiors with that precision of taste, where interior becomes art
@coty_495 - who has a spirit of the most beautiful warrior to manage insane chaotic art events and bring them to completion with perfect grace
@havensway - who can catch the subtle magic off guard and capture it on photographs ( who took this amazing shot ! )
@javiercisternasnajle - who is so dedicated to his Sitar music practice and can enchant audiences with its sound and his energy.
@_bringthehorizon_ - who can tell stories in videos capturing the essence of someone's creativity and the epic scale of nature
.
Those are the people that I had just RECENTLY a privilege of interacting with either online or in person. If I go through my life to the past - there will be hundreds more. If I go through my life to the future - there will be thousands more. Look at us, fine people, THE WORLDis in our hands TO CREATE.
